import React, { Component } from "react";
import Image from "./Image";
export default class Content extends Component {
  render() {
    return (
      <>
        <div className="container">
          <Image />
          <div className="comments">
            <p>Comments:</p>
            <div className="comment">
              <p>Comment 1</p>
            </div>
            <div className="comment">
              <p>Comment 2</p>
            </div>
            <div className="comment">
              <p>Comment 3</p>
            </div>
          </div>
        </div>
      </>
    );
  }
}
